column3:
Congratulations Daniel Kyri and Bea Cordelia on your selection as the city of Chicago's 2018 Filmmakers in Residence for &quot;THE T&quot;! Special thanks to Full Spectrum Features for taking on production. 

&quot;Native Chicagoans Cordelia and Kyri were selected for their originality and commitment to telling stories that are unique to Chicago,&quot; said Commissioner Mark Kelly, Department of Cultural Affairs and Special Events. &quot;We are excited to have two award-winning artists as our Filmmakers in Residence this year and look forward to seeing the forward-thinking series they are planning to produce.&quot;

In #TheTTV former-lovers-and-now-best-friends Jo and Carter are looking for love--it's not going well. A young white transwoman and queer Black man living in their native Chicago, they may have the world's bigotry and their own insecurities stacked against them, but at least they have each other
